import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

export default class Order extends Component {
  constructor(props) {
    super(props);

    this.state = {
      orders: '',
    }
  }
    componentDidMount() {
      axios.get('http://localhost:5000/items/')
        .then(response => {
          
          if (response.data.length > 0) {
            this.setState({
              orders: response.data.items,
            })
          }
        })
        .catch((error) => {
          console.log(error)
        })
  
    }


  render() {
    return (
      <div class="contain">
          <div id="brucecont">
            <div id="bruce">
              Bruce's Diner
            </div>
          </div>
            <div id="nav">
              <ul>
              <li id="left"><a href="/order">Order Form</a></li>
                <li id="mid"><a href="/view">View Orders</a></li>
                <li id="right"><a href="/landing">Log Out</a></li>
              </ul>
            </div>
            <div>

            </div>
      </div>
    );
  }
}
